import './App.css';
import Navbar from './Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './Home';
import NoteDetails from './NoteDetails';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            <Route exact path='/'>
              <Home />
            </Route>
            <Route exact path='/notes/:id'>
              <NoteDetails />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
